import React from "react";
import { Navigate, Route, Routes } from "react-router-dom";

export const AppRouter = () => {
  return (
    <React.Fragment>
      <Routes>
        {/*Routes */}
        <Route>
          <Route path="/tickets" element={<Navigate to="/tickets" />} />
          <Route path="/" element={<Navigate to="/tickets" />} />
        </Route>
      </Routes>
    </React.Fragment>
  );
};
